import React from 'react';

const Challenge = (props) => {
      if(props.position === 0) {
        return <span className='challenge'>{props.challenges[0]}</span>
      }
      if(props.position === 0.25) {
        return <span className='challenge'>{props.challenges[1]}</span>

      }
      if(props.position === 0.5) {
        return <span className='challenge'>{props.challenges[2]}</span>

      }
      if(props.position === 0.75) {
        return <span className='challenge'>{props.challenges[3]}</span>
      }


  return (
    <React.Fragment>
      <Challenge />
    </React.Fragment>
  );
};

export default Challenge;
